  // Analyze the availability data to find the best 2-hour consecutive slots
  const participants = [
    "Assistant", "jinghanz", "junteng", "Junxian", "shiqi", "Ting Wu", 
    "Wei Liu", "Weihao Zeng", "YANG Cheng", "zengweihao96@gmail.com", "童雨轩", "黄裕振"
  ];

  // Time slots start from 9:00 AM and go to 5:00 PM (8 hours = 32 15-minute slots per day)
  // Days: Mon, Tue, Wed, Thu, Fri (5 days)
  // Total slots: 160 (32 slots * 5 days)

  const timeSlots = [];
  const days = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday'];

  // Generate time slots for each day
  for (let day = 0; day < 5; day++) {
    for (let hour = 9; hour < 17; hour++) {
      for (let quarter = 0; quarter < 4; quarter++) {
        const minutes = quarter * 15;
        const timeString = `${hour}:${minutes.toString().padStart(2, '0')}`;
        const ampm = hour >= 12 ? 'PM' : 'AM';
        const displayHour = hour > 12 ? hour - 12 : (hour === 0 ? 12 : hour);
        const displayTime = `${displayHour}:${minutes.toString().padStart(2, '0')} ${ampm}`;

        timeSlots.push({
          day: days[day],
          time: displayTime,
          slotIndex: day * 32 + (hour - 9) * 4 + quarter
        });
      }
    }
  }

  // Get availability data from the page
  const availabilityData = [];
  if (window.AvailableAtSlot && window.TimeOfSlot) {
    for (let i = 0; i < window.TimeOfSlot.length; i++) {
      availabilityData.push({
        slotIndex: i,
        availableCount: window.AvailableAtSlot[i] ? window.AvailableAtSlot[i].length : 0,
        availableIds: window.AvailableAtSlot[i] || []
      });
    }
  }

  // Find best 2-hour consecutive slots (8 consecutive 15-minute slots)
  const bestSlots = [];
  for (let i = 0; i <= availabilityData.length - 8; i++) {
    let totalAvailability = 0;
    let minAvailability = 10;
    let isConsecutive = true;

    // Check if 8 consecutive slots are all on the same day
    const startDaySlot = i % 32;
    if (startDaySlot > 24) { // Can't fit 2 hours before day ends
      continue;
    }

    for (let j = 0; j < 8; j++) {
      if (i + j >= availabilityData.length) {
        isConsecutive = false;
        break;
      }
      const availability = availabilityData[i + j].availableCount;
      totalAvailability += availability;
      minAvailability = Math.min(minAvailability, availability);
    }

    if (isConsecutive) {
      const dayIndex = Math.floor(i / 32);
      const startSlotInDay = i % 32;
      const startHour = 9 + Math.floor(startSlotInDay / 4);
      const startMinute = (startSlotInDay % 4) * 15;
      const endHour = startHour + 2;

      bestSlots.push({
        startSlot: i,
        day: days[dayIndex],
        startTime: `${startHour > 12 ? startHour - 12 : startHour}:${startMinute.toString().padStart(2, '0')} ${startHour >= 12 ? 'PM' : 'AM'}`,
        endTime: `${endHour > 12 ? endHour - 12 : endHour}:${startMinute.toString().padStart(2, '0')} ${endHour >= 12 ? 'PM' : 'AM'}`,
        totalAvailability,
        minAvailability,
        avgAvailability: totalAvailability / 8
      });
    }
  }

  // Sort by average availability (descending)
  bestSlots.sort((a, b) => b.avgAvailability - a.avgAvailability);

  return {
    participants,
    totalParticipants: participants.length,
    activeParticipants: window.AvailableIDs ? window.AvailableIDs.length : 10,
    totalSlots: availabilityData.length,
    bestSlots: bestSlots.slice(0, 5), // Top 5 best slots
    sampleAvailability: availabilityData.slice(0, 10)
  };
}"}
